import React from "react";
import img2 from "../images/lucas-5tRmLGguL3Q-unsplash.jpg";
function Aboutus() {
  function ani() {
    document.getElementById('classname').className = 'classname1';
  }
  return (
    <div>
      <div>
        <p>Learning</p>
        <div class="box1">
        <button onClick={ani}> click me </button>
        <div class="classname1" id="classname">
              <h1>are you student?</h1>
            </div>
         
            <img src={img2} alt="Avatar" class="imagelaptop1" />
        
          </div>
      </div>
    </div>
  );
}

export default Aboutus;
